    [],nt"num_tags": 0,nt"name": "dissolved-inorganic-carbon-ph-alkalinity-temperature-salinity-and-other-variables-collected-fro98fea",nt"isopen":
    false,nt"url": null,nt"notes": "NCEI Accession 0144303 includes discrete
    sample and profile data collected from HUDSON in the Davis Strait, Gulf of St. Lawrence,
    Labrador Sea and North Atlantic Ocean from 2013-05-07 to 2013-05-28. These data
    include AMMONIUM (NH4), CHLOROFLUOROCARBON-12 (CFC-12), DISSOLVED INORGANIC CARBON
    (DIC), DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, SALINITY, SULFUR
    HEXAFLUORIDE (SF6), TOTAL ALKALINITY (TA), WATER TEMPERATURE, pH, phosphate and
    silicate. The instruments used to collect these data include Alkalinity titrator,
    CTD, Coulometer for DIC measurement and bottle.nnThese data were collected by Igor
    Yashayaev and Kumiko Azetsu-Scott of Bedford Institute of Oceanography as part of
    the CLIVAR_AR07W_2013 data set. CDIAC associated the following cruise ID(s) with
    this data set: CLIVAR_AR07W_2013nnThe International CLIVAR Global Ocean Carbon and
    Repeat Hydrography Program carries out a systematic and global re-occupation of
    select WOCE/JGOFS hydrographic sections to quantify changes in storage and transport
    of heat, fresh water, carbon dioxide (CO2), and related parameters.nnThe World Ocean
    Circulation Experiment (WOCE) was a major component of the World Climate Research
    Program with the overall goal of better understanding the ocean's role in climate
    and climatic changes resulting from both natural and anthropogenic causes. The CO2
    survey took advantage of the sampling opportunities provided by the WOCE Hydrographic
    Program (WHP) cruises during this period between 1990 and 1998. The final collection
    covers approximately 23,000 stations from 94 WOCE cruises.",nt"owner_org":
